@section('script')
    <script src="https://app.sandbox.midtrans.com/snap/snap.js" data-client-key="{{ env('MIDTRANS_CLIENT_KEY') }}"></script>
    <script type="text/javascript">
        $('.expedision-type').on('change', function(){
            let ongkir = parseInt($('.expedision-type:checked').val());
            
            $('#total-ongkir').html('Rp ' + ongkir.toString().split('').reverse().join('').match(/\d{1,3}/g).join('.').split('').reverse().join(''));

            let total = ongkir + {{ $transaksi->total }};
            $('#total').html('Rp ' + total.toString().split('').reverse().join('').match(/\d{1,3}/g).join('.').split('').reverse().join(''));

            $('#pay-button').prop('disabled', false);
        });

        $('#pay-button').off('click').on('click', function() {

            $('#pay-button').prop('disabled', true);

            let data = {
                id: '{{ $transaksi->id }}',
                total: parseInt($('.expedision-type:checked').val()) + {{ $transaksi->total }}
            }

            $.ajax({
                url: '/transaksi/bayar',
                method: 'POST',
                data: data,
                headers: {
                    'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
                },
                success: function(response){
                    snap.pay(response.data.snap_token, {
                        onSuccess: function(result){
                            changeTransactionStatus(response.data.id, 'success');

                            console.log('pembayaran berhasil');
                        },
                        onPending: function(result){
                            console.log('pembayaran dipending');
                            
                            window.location.href = "/keranjang";
                        },
                        onError: function(result){
                            console.log('pembayaran gagal');
                            changeTransactionStatus(response.data.id, 'failed');
                        }
                    });
                },
                error: function(error){
                    console.error(error);
                },
                complete: function(){
                    $('#pay-button').prop('disabled', false);
                }
            });

        });

        $('#change-address-form').on('submit', function(e){
            e.preventDefault();
            
            let data = {
                id: $('.select-address:checked').val()
            };

            $.ajax({
                url: '/alamat',
                method: 'PUT',
                data: data,
                headers: {
                    'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
                },

                success: function(response){
                    console.log(response.message);

                    location.reload();
                },
                error: function(error){
                    console.error(error);
                }
            });
        });

        function changeTransactionStatus(id, status) {
            $.ajax({
                url: '/transaksi/bayar',
                method: 'POST',
                async: false,
                data: {
                    id: id,
                    status: status
                },
                headers: {
                    'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
                },
                success: function(result){
                    console.log(result.message);
                    window.location.href = "/keranjang";
                }
            });
        }
    </script>
@endsection
